 import React  from "react";

 function ProductDetails({photo,price}){
    return(
        <div>
            <img src={photo}/>
            <div>price is {price}</div>
            <input type={Number}/>
            <button className="rounded-md text-yellow-600"> Add to cart </button>

        </div>
    );
 }

 export default ProductDetails;
